export const updateMnemonic = async ({ kanjiId, userId, mnemonicText }) => {
    const response = await fetch('/api/kanji/mnemonic', {
        method: 'POST',
        body: JSON.stringify({ kanjiId, userId, mnemonicText }),
        headers: {
            'Content-Type': 'application/json'
        }
    })
    const json = await response.json()
    console.log(json)
}
